INSERT INTO `mhy_goods` VALUES ('16', '17', '男女服装 &gt; 女装 &gt; 毛呢大衣', 'a:2:{i:1;s:6:\"颜色\";i:2;s:6:\"尺码\";}', 'a:2:{i:1;a:2:{i:1;s:6:\"白色\";i:8;s:6:\"褐色\";}i:2;a:3:{i:15;s:1:\"S\";i:16;s:1:\"M\";i:17;s:1:\"L\";}}', '3f167760d8640f6c5c11f7f47efcd18d.jpg_small.jpg', '3f167760d8640f6c5c11f7f47efcd18d.jpg_tiny.jpg,bc7d905825c408d26339b82ffffc3c63.jpg_tiny.jpg,b5c8b569d50fc45782f930cb5978f2ed.jpg_tiny.jpg,c2c8e577956049de1c2be4fc6fca7745.jpg_tiny.jpg,9edbb02b5a21368228ec2a1451107ad8.jpg_tiny.jpg', '', '0', '0', '<p>\r\n	面料说明\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	衣服主面料采用双面呢，该面料平整不易起皱，是众多品牌公司制作呢子大衣的首选面料。O.SA制作的布面无杂质且颜色纯正，饱满细腻，面料的所有品质指标都优于国家质量标准。\r\n</p>\r\n<p>\r\n	工艺说明\r\n</p>\r\n<p>\r\n	很\r\n帅气的一款大衣，经典双排扣设计，杏色，优雅深邃。细节繁多，做工超复杂，门襟有混花纹纽扣。腰的分割线设计位置比较低，更加的时尚，同时更能衬托体型。\r\n这里最要提到的是衣服的花瓣型的边缘，非常的美轮美奂，很别致，这弧线形的做法无论是在缝纫还是在裁剪的过程中对技术的要求都是非常高的，稍不留神就会做\r\n成次品。这个还是暗藏玄机的哦，在花瓣边下面有条拉链，可以吧下摆拆卸下来，做一件短款的大衣穿着，也是非常好看的，然后领子也是可以拆卸的，所以说一件\r\n衣服有三种穿法，这就是时下最流行的“变形金刚”。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<img src=\"upload/store/goods/2/3f167760d8640f6c5c11f7f47efcd18d.jpg\" /><br />\r\n<br />\r\n<img src=\"upload/store/goods/2/9edbb02b5a21368228ec2a1451107ad8.jpg\" /><img src=\"upload/store/goods/2/bc7d905825c408d26339b82ffffc3c63.jpg\" /><img src=\"upload/store/goods/2/b5c8b569d50fc45782f930cb5978f2ed.jpg\" /><img src=\"upload/store/goods/2/c2c8e577956049de1c2be4fc6fca7745.jpg\" />', '1336358748', '1336963548', '0', '1322116050', '0', '10');
